import React from 'react';

function MovieItem({ movie }) {
  return (
    <div>
      <h2>{movie.title}</h2>
      <p>Language: {movie.language}</p>
      <p>Country: {movie.country}</p>
    </div>
  );
}

export default MovieItem;
